import React, { Component } from 'react'
import Nav from '../../components/navbar';

export default class SearchComponent extends Component {
  render() {
    return (
      <>
      <Nav/>
        <div className="bg-green-700 p-4">
            <input type="text" name="" id="" className="bg-white mr-5 rounded-lg py-1 px-3"/>
            <input type="checkbox" name="" id="" className="ml-3"/> Jumia 
            <input type="checkbox" name="" id="" className="ml-3"/> Konga
            <input type="checkbox" name="" id="" className="ml-3"/> Amazon
            <input type="checkbox" name="" id="" className="ml-3"/> OLX Nigeria
            <input type="checkbox" name="" id="" className="ml-3"/> Jiji
            <button className="bg-white rounded-lg py-1 px-3"> Search For Goods </button>
        </div>
      </>
    )
  }


}
